function getDailyRandomNumbers(day, count = 4, max = 443) {
    const numbers = new Set();
    for (let i = 0; numbers.size < count; i++) {
        const seed = (day * 2654435761 + i * 997) % (2 ** 32); // Slight variation in seed
        const randomNum = seed % (max + 1);
        numbers.add(randomNum); // Use a Set to avoid duplicates
    }
    return Array.from(numbers);
}

