function share(which) {
	var wfour = 0;
	var wfive = 0;
	var wsix = 0;
	var wseven = 0;
	var sum = 0;
	for (let i = 0; i < alpha.length; i++) {
		x = document.querySelectorAll('.' + alpha[i].toString()).length;
		if (x == 4) {
			wfour = wfour + 1
		} else if (x == 5) {
			wfive = wfive + 1
		} else if (x == 6) {
			wsix = wsix + 1
		} else if (x == 7) {
			wseven = wseven + 1
		} else {}
	}
	sum = wfour + wfive + wsix + wseven;
	var p = document.getElementById("sharecontent").innerHTML;
	if (which != null) {
		var pLines = p.split("\n");
		var pGoodLines = [];
		for (let j = 0; j < pLines.length; j++) {
			if (getCharacterLength(pLines[j]) === which) {
				pGoodLines.push(pLines[j]);
			}
		}
		p = pGoodLines.join("\n");
	}
	x = "WikiWorte #" + gameNumber + "\n" +
		"Versuche: " + sum + "\n" +
	//	"4-" + wfour + " 5-" + wfive + " 6-" + wsix + " 7-" + wseven + "\n" +
		p + "\n" + "#wikiworte\n";
	if (navigator.share) {
		navigator.share({
				url: window.location.href,
				text: x,
			})
			.then(() => console.log('Successful share'))
			.catch((error) => console.log('Error sharing', error));
	} else {}
}

