function vibrate(x, y, z) {
	const element = document.getElementsByClassName(x);
	for (let i = 0; i < element.length; i++) {
		element[i].classList.add(y);
	}
	setTimeout(function() {
		for (let i = 0; i < element.length; i++) {
			element[i].classList.remove(y);
		}
	}, z);
}

