function initialize() {
	if (window.matchMedia && window.matchMedia('(prefers-color-scheme: dark)').matches) {
		isDarkMode = true
	} else {
		isDarkMode = false
	}
	if (localStorage.getItem("darksess") != null) {
		isDarkMode = (localStorage.getItem("darksess") == 'true');
	} else {}
	if (isDarkMode) {
		document.getElementById('loading').background = '#353535';
		darkon();
	} else {
		document.getElementById('loading').background = '#353535';
		darkoff();
	}
	populatewords();
	isnewgamehere();
	document.getElementById('loading').style.display = 'none';
}

function getCharacterLength(str) {
	// The string iterator that is used here iterates over characters,
	// not mere code units
	return [...str].length;
}
